package binarySearch.LongestDuplicateSubstring_1044;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;

public class SolutionTest {
    @Test
    public void test() {
        Solution s = new Solution();
        assertEquals("ana", s.longestDupSubstring("banana"));
        assertEquals("", s.longestDupSubstring("abcd"));
        assertEquals("nana", s.longestDupSubstring("nanana"));
        assertEquals("nana", s.longestDupSubstring("nanana"));
        assertEquals("akyj", s.longestDupSubstring(""));
        assertEquals("aeeebaabd", s.longestDupSubstring(""));
        assertEquals("dccdbcebdda", s.longestDupSubstring(""));
        assertEquals("mqqqv", s.longestDupSubstring(""));
    }
}